import React from 'react'
import { Formik, Form } from 'formik'
import { TestField } from './TestField'


export const Signup = () => {
    return (
        <Formik
            initialValues={{
                firstName: '',
                lastName : '',
                email: '',
                password: '',
                confirmPassword: ''
            }}
        >
            {formik => (
                <div>
                    <h1 className="my-4 font-weight-bold-display-4">Sign Up</h1>
                    {console.log(formik)}
                    <form>
                         <TestField label="First Name" name="firstName" type="text" ></TestField>
                         <TestField label="Last Name" name="lastName" type="text" ></TestField>
                         <TestField label="Email" name="email" type="email" ></TestField>
                         <TestField label="Password" name="password" type="password" ></TestField>
                         <TestField label="Confirm Password" name="confirmPassword" type="password" ></TestField>
                         <button className="btn btn-dark mt-3" type="submit" >Register</button>
                         <button className="btn btn-danger mt-3 ml-3" >Register</button>
                    </form>
                </div>
            )}
        </Formik>
    )
}
